	void writeSmartFilter(vector< vector<int>> pic, int startX, int startY, int sizeX, int sizeY) {
		
		int size = sizeX*sizeY;
		std::ofstream ofs;
  		ofs.open ("trainingResults/regular.txt", std::ofstream::out | std::ofstream::app);
  		ofs << "int smartFilter [" << size << "] = {";
  		for(int y = startY; y<sizeY+startY; y++) {
  			for(int x = startX; x<sizeX+startX; x++) {
  				ofs << pic[y][x] << ", ";
  			}
  		}
  		ofs << "};";
  		ofs.close();
	
	}
	
