	int checkRegularSmartFilters(vector< vector<int>> pic, int startX, int startY, int sizeX, int sizeY) {
		int count = 0;
		vector<int> scores;
		for(int i = 0; i<11; i++) scores.push_back(0);
		
		for(int y = startY; y<sizeY+startY; y++) {
  			for(int x = startX; x<sizeX+startX; x++) {
  				for(int i = 0; i<11; i++) {
					if(regularFilters[i][count] ==	pic[y][x]) scores[i] = scores[i] + 1;
					else scores[i] = scores[i] - 1; 			
				}
				count++;
  			}
  		}
		for(int i = 0; i<11; i++) if(scores[i] > 900) {
			cout << "SmartFilter Score: " << scores[i] << "\r\n";
			return 1;
		}
		return 0;
	}
	
